import {
	HiMenu,
	HiUser,
    HiUserGroup
} from 'react-icons/hi'

export const DASHBOARD_SIDEBAR_LINKS = [
	{
		key: 'dashboard',
		label: 'Dashboard',
		path: '/',
		icon: <HiMenu />
	},
	{
		key: 'admin',
		label: 'Admin',
		path: '/admin',
		icon: <HiUser />
	},
	{
		key: 'student',
		label: 'Student',
		path: '/student',
		icon: <HiUserGroup />
	}
	/*{
		key: 'customers',
		label: 'Customers',
		path: '/customers',
		icon: <HiOutlineUsers />
	},
	{
		key: 'transactions',
		label: 'Transactions',
		path: '/transactions',
		icon: <HiOutlineDocumentText />
	},
	{
		key: 'messages',
		label: 'Messages',
		path: '/messages',
		icon: <HiOutlineAnnotation />
	}*/
]

export const DASHBOARD_SIDEBAR_BOTTOM_LINKS = [
	{
		key: 'settings',
		label: 'Settings',
		path: '/settings',
		icon: ''
	},
	{
		key: 'support',
		label: 'Help & Support',
		path: '/support',
		icon: ''
	}
]
